    padding: 0;
    margin: 0;
    color: #a09e9e;
    background: #eff7f8;
}

.display-middle {
    position: absolute;
    top: 45%;
    left: 50%;
    transform: translate(-50%,-50%);
    -ms-transform: translate(-50%,-50%);
}
.display-middle h1{
    font-weight:400;
}
.display-middle h3{

}
.text-center {

}
.jumbo {
    font-size: 40px!important;
    margin-top: 50px;
    margin-bottom: 0px;

}
.jumbo code{

}
.icon{
    font-size: 80px;
    margin:0;
}
.btn-primary {
    box-shadow: 0 0.125rem 0.625rem #8bc34a61, 0 0.0625rem 0.125rem #8bc34a52;
    color: #fff;
    background-color: #82b440;
    border-color: #82b440;
}
.btn-primary:hover {
    color: #fff;
    background: #689f38 !important;
    border-color: #82b440;
}
.btn-primary:active {
    box-shadow: 0 0.125rem 0.625rem #8bc34a61, 0 0.0625rem 0.125rem #8bc34a52;
    color: #fff;
    background-color: #82b440 !important;
    border-color: #82b440 !important;
}
.btn {
    display: inline-block;
    font-weight: 400;
    color: #fff;
    text-align: center;
    vertical-align: middle;
    cursor: pointer;
    padding: 0.375rem 0.75rem;
    font-size: 0.8rem;
    line-height: 1.5;
    border-radius: 10px;
    text-decoration: none;
    margin-top:10px;
}
.back-btn{
    display: flex;
    justify-content: center;
}
</style>
